import React from 'react'
import ArtData from '../assets/_legacy-art.json'
import FeatureList from '../components/FeatureList'
import { useState, useEffect } from 'react'
import axios from "axios";

function SearchList() {

  const ArtData = (url) => {
    const [artData, setArtData] = useState(null);
    const [error, setError] = useState("");
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
      axios
        .get(url)
        .then((response) => setArtData(response.data))
        .catch((error) => setError(error.message))
        .finally(() => setLoaded(true));
    }, []);

    return { artData, error, loaded };
  };
  const {artData,error,loaded} = ArtData('http://localhost:3001/v1/heartofvalley/features')

  return (

    <div className="border-1 mt-5 d-flex flex-column">

      {(loaded === true) ? artData.map((data, key) => {
                      return <FeatureList imgAddr={data.imagePath}  title={data.title} description={data.Description} artistname={"data"}/>
                  }): <h4>Loading Error...</h4>}

         {/* {artData.map((data, key) => {
             {console.log("data",data,key)}
                return <FeatureList imgAddress={data.imagePath}  title={data.title} description={data.Description} artistname={"data"}/>;
            })} */} 
    </div>
  )
}

export default SearchList
